       // if(arr[i]==result[j]) count +=1;                                 //Unique Character
          if(arr[i]==arr[j]) count +=1;
      }
      if(count==1){                                                      //RD
   // if(count==0){                                                      //UC
          result.push(arr[i]);
      }  
  }

  console.log(result)
}

removeDup();
`.trim()

const compare_array = `
function compare(){
  const arr=[1,2,3,4,5,6];
  const arr2=[5,6,7,8,9,0];
  const result=[];

  for(let i=0; i<arr.length; i++){
    if(arr2.indexOf(arr[i]) !== -1){
      result.push(arr[i]);
    }
  }
  console.log(result)
}

compare();


//Unique name
function getUnique(){
  var names = ["John", "Peter", "Clark", "Harry", "John", "Alice"];
  var newName = [];

  for(i=0; i < names.length; i++){
      if(newName.indexOf(names[i]) === -1) {
          newName.push(names[i]);
      }
  }
  console.log(newName);
}

getUnique();
`.trim();

const findMedianSortedArrays = `
const median = () => {
  const arr = [1,12,15,26,38];
  const arr2 = [4,3,1];
  let arrMedian=[];

  const result = [...arr, ...arr2].sort((a, b) => a - b);
  const half = result.length / 2 | 0;

  if (result.length % 2){
      arrMedian=result[half];
  }
  else{
      arrMedian=((result[half] + result[half-1])/2);
  }
  return console.log(arrMedian);
}

median()
`.trim();

const plusOne = `
function plusOne(){
  const arr=[1,2,3];
  let result=[], result2=[];

  for(let i=0; i<arr.length; i++){
    result.push(arr[i]);
    result2 = arr[arr.length-1]+1
  }

  result.pop();
  result.push(result2);
  console.log(result)
}

plusOne();
`.trim();

const arrayCounter = `
function arrCounter(arr){
  var counter = 0;
  var maxCount = 0;

    function inner(n){
      if(!Array.isArray(n)){
        maxCount = Math.max(maxCount, counter);
     counter = 0;
     return
   }

   n.forEach(num => {
   counter ++;
   inner(num);
   })
 }

 inner(arr);
 console.log(maxCount)
 return maxCount;
}

arrCounter([[3]])
arrCounter([[[[[[[9]]]]]]])
arrCounter([])
`.trim()

const countElements = `
function arrCounts(){
  const arr = [1,2,3,4,5];
  var result = 0;

  while(arr[result]!==undefined){
    result++;
  }
  console.log(result);
}

arrCounts();  


