const numIdenticalPairs = `
function numIdenticalPairs(nums) {
  let count = 0

  for (let i=0; i<nums.length; i++) {
    for (let j=(i+1); j<nums.length; j++) {
      if (nums[i] === nums[j]) {
        count += 1
      }
    }
  }
  return count
}

console.log(numIdenticalPairs([1,2,3,1,1,3]))
`.trim();

const removeElement = `
function removeEle(){
  const arr=[1,2,3,5,4];
  let ele=3;
  let removeEle=[];

  while(ele>0){ 
      removeEle +=arr.pop(ele)
      ele--;
  }

  console.log(removeEle)
  console.log("Remain elements", arr)
}

removeEle();
`.trim();

const shuffle = `
function shuffle() {
  const arr = [7,8,9,10];
  const n=3;

  for (let i=arr.length-1; i>0; i--) {
    let j = Math.floor(Math.random() *(i+n));
    let temp = arr[i];
    arr[i] = arr[j];
    arr[j] = temp;
  }
  console.log(arr);
}

shuffle()
`.trim();

const searchRange = `
function positionEle(){
  const arr = [5,7,7,8,8,10], target = 8;
  let result=[];
  let i;

  for(i=0; i<arr.length; i++){
    if(arr[i]==target){
      result.push(arr.indexOf(target));
    }
  }
  console.log(result);
}

positionEle();
`.trim();

const combinationSum = `
function combinationSum(){
  const arr=[1,2,3,6,4,5];
  const target = 7;
  let result=[];

  for(let i=0; i<arr.length; i++){
    for(let j=i; j<arr.length; j++){
      if(arr[i]+arr[j]==target){
        result.push(arr[i],arr[j])
      }
    }
  }  
  console.log(result);
}

combinationSum();
`.trim();

const missing_number = `
